import { Outlet, Link } from "react-router-dom";
import "../App.css";
import NavBar from "../components/nav";

const Layout = () => {
  return (
    <>
    <Navbar/>
    <nav>
      <ul class="navbar">
        <li>
          <Link class= "nav-item" to="/">Home</Link>
        </li>
        <li>
          <Link class= "nav-item" to="/contact">Contact</Link>
        </li>
      </ul>
    </nav>
    <Outlet/>
    </>
  )
};

export default Layout;
